import {createBottomTabNavigator} from "@react-navigation/bottom-tabs";
import {Button, FlatList, StyleSheet, Text, TextInput, View, RefreshControl} from "react-native";
import {NavigationContainer} from "@react-navigation/native";
import axios from "axios";
import {useCallback, useEffect, useState} from "react";


const Tab = createBottomTabNavigator();

const Home = () => {

    const [items, setItems] = useState(null);
    const [refreshing, setRefreshing] = useState(false);

    onRefresh = useCallback(()=>{
      setRefreshing(true);
      axios.get("http://localhost:8080/items")
      .then(result => setItems(result.data))
      .catch(err => console.log(err));
      setTimeout(()=>{
      setRefreshing(false);
      setTimeout(() => {
        setRefreshing(flase);
      },2000);
      },)

    })
    useEffect(()=>{
        axios.get("http://localhost:8080/items")
            .then(result => setItems(result.data))
            .catch(err => console.log(err));
    },[])

    return (
        <FlatList data={items}
                  keyExtractor={(item) => item.itemId}
                  renderItem={({item}) =>
                      <View style = {styles.itemBox}>
                        <Text style={styles.itemName}>{item.itemName}</Text>
                        <Text>{item.city}{item.gu} {item.dong}</Text>
                        <Text>{item.createDate}</Text>
                        <Text style = {styles.itemPrice}>{item.price} 원</Text>
                      </View>}/>

    );
};

const Life = () => {
  return (
      <View>
        <Text>동네 생활 페이지</Text>
      </View>
  );
};

const ItemRegisterPage = () =>{

    const [name, onChangeName] = useState("제목을 입력하세요");
    const [price, onChangePrice] = useState("가격을 입력하세요");
    const [content, onChangeContent] = useState("내용을 입력하세요");
    const id = 1;
  return (
      <View>
          <View style={{marginVertical:10,
                        marginHorizontal:10
          }}>
              <Text style={
                styles.text
              }>제목
              </Text>
              <TextInput
                  style={styles.input}
                  onChangeText={onChangeName}
                  value={name}/>

              <Text style={
                styles.text
              }>
                가격
              </Text>
              <TextInput
                style={styles.input}
                onChangeText={onChangePrice}
                value={price}
                keyboardType="numeric"
              />
              <Text style={
                styles.text
              }>
                내용
              </Text>
              <TextInput
                style = {styles.input}
                onChangeText={onChangeContent}
                value = {content}
              />
          </View>



        <Button title="Create Item" onPress={()=>{

            axios.post("http://localhost:8080/items/new",
                JSON.stringify({
                    id,name, price, content
                }),{
                    headers: {
                        'Content-Type': 'application/json'
                    }
                }
            ).then(()=>{
                console.log("success");
                console.log(name);
                console.log(price);
            }).catch((error) => console.log(error));
        }}/>
      </View>
  );
};

const MyPage = () =>{
  return (
      <View>
        <Text>My page</Text>
      </View>
  );
};

const MyTabs = () =>{

  return (
      <NavigationContainer>
      <Tab.Navigator>
        <Tab.Screen name="홈" component={Home}/>
        <Tab.Screen name="동네생활" component={Life}/>
        <Tab.Screen name="아이템 등록 페이지" component={ItemRegisterPage}/>
        <Tab.Screen name="나의 당근이지" component={MyPage}/>
      </Tab.Navigator>
      </NavigationContainer>
  );
};

const styles = StyleSheet.create({
  container:{
    flex:1,
    backgroundColor:"#708090"
  },

  itemBox : {
    marginHorizontal:20,
    marginVertical:10,
    paddingVertical: 10,
    borderBottomWidth : 1,
  },
  itemName : {
    fontSize:20,
    padding:2
  },

  itemPrice : {
    fontSize:20,
    padding:2,
    fontWeight : "bold"
  },
  input :{
      height:40,
      margin:12,
      borderWidth:1,
      height:80
  },
  text : {
    fontSize:20,
    padding:10
  }
})

export default MyTabs;
